import React from 'react'
import { View, Image, StyleSheet } from 'react-native'

export default function Save(props) {
    return (
        <View style={{ flex: 1}}>
            <Image source={{uri: props.route.params.image}} style={{ flex: 1, width: '100%', height: '100%', resizeMode: 'contain'}}/>
        </View>
    )
}
const styles = StyleSheet.create({
    cameraContainer: {
      flex: 1,
      flexDirection: 'row',
    },
    fixedRatio: {
      flex: 1,
      aspectRatio: 2 / 3
    }
  })
